                                    </div>
                                    <div className='registrate'>
                                        <p>Â¿Ya estÃ¡s registrado?<a className='registrar' href='/registro'> Inicia sesiÃ³n</a></p>
                                    </div>
                                    <div className='form-button'>
                                        <button>{isLoading ?
                                            <BtnLoad />
                                            :
                                            "RegÃ­strate"
                                        }
                                        </button>
                                    </div>
                                </form>                               
                            </div></>}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Register;
